import React from 'react';
import Navbar from '../components/Navbar';
import { motion } from 'framer-motion';


const WhatWeDeliver = () => {
  return (
    <div className="min-h-screen animate-slideIn">
      {/* First Section - Dark Blue */}
      <section className="relative min-h-screen bg-[#070c24] flex flex-col items-center justify-center">
        <Navbar />
        <div className="container mx-auto px-4 pt-20">
          <h1 className="text-4xl md:text-6xl text-white font-bold mb-6">
            What We Deliver
          </h1>
          <p className="text-white/80 text-lg md:text-xl max-w-2xl">
            Explore our comprehensive solutions and deliverables that drive success.
          </p>
        </div>
        <div className="absolute left-1/2 bottom-1 -translate-x-1/2 flex flex-col items-center gap-2">
                    <div className="w-[1px] h-24 bg-white/20 relative overflow-hidden">
                      <motion.div
                        className="w-full h-full bg-white"
                        animate={{
                          y: ['-100%', '100%'],
                        }}
                        transition={{
                          repeat: Infinity,
                          duration: 1.5,
                          ease: 'linear',
                        }}
                      />
                    </div>
                  </div>
                   <h3
            onClick={handleBackToHome}
            className="fixed bottom-40 left-8 md:left-24 text-white text-lg cursor-pointer hover:text-green-300 transition-colors duration-300 flex items-center gap-2 group z-40"
          ></h3>
        
      </section>

      {/* Second Section - White */}
      <section className="min-h-screen bg-white py-16">
        <div className="container mx-auto px-4">
          <h2 className="text-3xl md:text-4xl text-gray-900 font-bold mb-8">
            Our Solutions
          </h2>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
            {/* Add your content here */}
          </div>
        </div>
      </section>
    </div>
  );
};

export default WhatWeDeliver;
